import styled from "styled-components";
import { BoxContainer } from "../box_mini/box_m";

export const SubmitCon = styled.div`
background-color: red ;
width: 100%;
height: 320px;
background-color: #DFFFE3;
display: flex ;


`

export const Submit_text = styled.div`
display: flex ;
flex-direction: column ;
justify-content: space-around ;
margin: 50px  100px ;
`
export const Submit_text1 = styled.h2`
width: 475px ;
height:  50px;

`
export const Submit_text2 = styled.p`
width: 458px;
height: 52px;
`
export const Submit_inp = styled.input`
border: none ;
width:451px ;
height: 56px ;
`
export const Submit_Coninp=styled.div`
margin: 50px 0px;
`



export const Submit_btn=styled.button`
background-color: #066F14;
width: 90px ;
 height: 40px ;
 border: none ;
 border-radius: 5px ;
 position:  absolute;
 left: 705px ;
top: 2553px ;
`

export const Submit_img = styled.img``
